import React from 'react';
import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import Operators from './components/operators/Operators';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import CheckList from './components/Check/CheckList';

function App(props) {
    return (
      <BrowserRouter>
        <div className="app__wrapper">
          <Header />

          <Switch>
            <Route
              exact
              path='/main'
              render={() => <Operators state={props.state} />}
            />
            <Route
              exact
              path={() => '/checklist/' + props.state[0].id}
              render={() => <CheckList state={props.state[0]} />}
            />
            <Route
              exact
              path={() => '/checklist/' + props.state[1].id}
              render={() => <CheckList state={props.state[1]} />}
            />
            <Route
              exact
              path={() => '/checklist/' + props.state[2].id}
            render={() => <CheckList state={props.state[2]} />}
            />
          </Switch>
          <Footer />
        </div>
      </BrowserRouter>
    );
}

export default App;
